import React, { useEffect } from "react";

export const VolcanoList = () => {
  const URL = "https://my-volcanos.herokuapp.com/";

  useEffect(() => {
    fetch(URL)
      .then((res) => {
        console.log(res);
        return res.json();
      })
      .then((data) => {
        console.log(data);
      });
  }, [URL]);

  return <div>hejhej</div>;
};
